import React, { useEffect } from "react";

const loggedIn = () => {
  useEffect(() => {
    const { name, room } = queryString.parse(location.search);

    socket = io(ENDPOINT);
    setName(name);
    setRoom(room);
    socket.emit("join", { name, room }, (error) => {
      if (error) {
        alert(error);
      }
    });
  }, [ENDPOINT, location.search]);
  return <h1>U have logged In!</h1>;
};
export default loggedIn;
